import React from 'react';
import { StyledForm } from './loginFormStyle';
import CookingPhoto from '../../assets/LoginMainPhoto.png';



const LoginForm = () => {
    return (
        <StyledForm>
            <h1>Login Form</h1>
            <img src={CookingPhoto} alt="CookingPhoto" />
        </StyledForm>
    )
}


export default LoginForm;
